import React from "react";
import data from "../data.js";


function createRow(input){
  return (
    <tr>       
    <td>{input.ak}</td>
    <td>{input.fname}</td>
    <td>{input.lname}</td>      
   </tr>
  );
}




function TableData(){
    return (
      data.map(createRow)
    );
}


export default TableData;
